import React,{Component} from 'react';
import logo from './logo.svg';
import './App.css';
import Header from './components/header';
import CarList from './components/carList';

export default class App extends Component {
  render() {
    const example = [{
      type: 'sedan',
      picture: { thumbnail: './stock.png' },
      brand: 'BMW',
      model: 'M4',
      year: '19',
      owner: 'carlet'
    }, {
      type: 'hatchback',
      picture: { thumbnail: './stock.png' },
      brand: 'FIAT',
      model: 'punto',
      year: '161',
      owner: 'puntolover'
    }, {
      type: 'suv',
      picture: { thumbnail: './stock.png' },
      brand: 'KIA',
      model: 'sportage',
      year: '142',
      owner: 'carlet'
    }, {
      type: 'estate',
      picture: { thumbnail: './stock.png' },
      brand: 'MERCEDES-BENZ',
      model: 'e300',
      year: '162',
      owner: 'carlet'
    }
    ];
    return (
      <div className="jumbotron">
        <div className="container-fluid">
          <div className="row">
            <div className="col-md-6 offset-3">
              <h1><a href='/'>Carlet Rentals</a></h1>
            </div>
          </div>
          <div className="row">
            <div className="col-md-6 offset-3">
              <Header noCars={example.length} />
            </div>
          </div>
          <div className="row">
            <div className="col-md-6 offset-3">
              <CarList cars={example} />
            </div>
          </div>
        </div>
      </div>
    )

  }
}
